export default function GetLastPlayData(data) {

    const lastPlayData = {
        'clock': data.cl,
        'teamID': data.tid,
        'playerID': data.pid,
        'eventType': data.etype,
        'event': data.evt,
        'description': data.de,
    };

    return lastPlayData;
}
